import windIcon from '../img/metrics/windIcon.svg';
import humidity from '../img/metrics/humidityIcon.svg';
import pressure from '../img/metrics/pressureIcon.svg';
import visibility from '../img/metrics/visibilityIcon.svg';

//Variable declarations
export let weatherIcons = [];
export let forecastIcons = [];
export let metricIcons = [windIcon, humidity, pressure, visibility];
export let metrics = ['Wind Speed', 'Humidity', 'Pressure' , 'Visibility'];
export let units = ['km/h', '%', 'hPa', 'km'];
export let days = ['Monday', 'Tuesday', 'Wensday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

export var getMetrics = function (type){
    let data = [];
    if ('Wind Speed'){
        data+=windIcon;
    }
}
